import React from 'react'

class List extends React.Component{
    render(){
        console.log(props.number);
        const numbers = Array.from(Array(props.number).keys());
        console.log(numbers);
        const listItems = numbers.map((n) => <li>Num {n}</li>);
        return(<ul>{listItems}</ul>);
    }
}


export default List;
